import React from 'react';
import './NotFound.css';
import Notfound from './images/NotFound.jpg';

const NotFound = () => {
  return (
    <div className='notfound'>
        <div className='content'>
            <h1>Not Found</h1>
        </div>
    </div>
  )
}

export default NotFound
